import { GriddleRedux } from './griddle-redux'
import { GriddleContainer } from './griddleContainer'

export { GriddleContainer, GriddleRedux }

//TODO: Move most of this functionality to the component or something like that :|
export function columnPropertiesFromArray(columns) {
  //TODO: Make this more efficient -- this is just kind of make it work at this point
  let properties = {};
  columns.forEach(column => properties[column] = ({id: column}));

  return properties;
}

export function buildColumnProperties({ rowProperties, allColumns, defaultColumns}) {
  let columnProperties = defaultColumns ? columnPropertiesFromArray(defaultColumns) : {};

  if(rowProperties && rowProperties.props && !!rowProperties.props.children && Array.isArray(rowProperties.props.children)) {
    columnProperties = rowProperties.props.children.reduce((previous, current) => {
      previous[current.props.id] = current.props; return previous;
    }, columnProperties)
  } else if (rowProperties && rowProperties.props && rowProperties.props.children) {
  //if just an object
    columnProperties[rowProperties.props.children.props.id] = rowProperties.props.children.props;
  }

  //TODO: Don't check this this way :|
  if(Object.keys(columnProperties).length === 0 && allColumns) {
    columnProperties = columnPropertiesFromArray(allColumns);
  }

  return columnProperties;
}

const PropertyHelper = {
  propertiesToJS({ rowProperties, allColumns, defaultColumns, ignoredColumns=[] }) {
    const getHiddenColumns = columnProperties => {
      const visibleKeys = Object.keys(columnProperties);
      const hiddenColumns = allColumns.filter(column => visibleKeys.indexOf(column) < 0);

      let hiddenColumnProperties = {};
      hiddenColumns.forEach(column => hiddenColumnProperties[column] = {id: column});

      return hiddenColumnProperties;
    }

    const ignoredColumnsWithChildren = ignoredColumns.indexOfChildren > -1 ? ignoredColumns : [...ignoredColumns, 'children']
    //if we don't have children return an empty metatdata object
    if(!rowProperties) {
      const columnProperties = columnPropertiesFromArray(defaultColumns || allColumns);
      const hiddenColumnProperties = getHiddenColumns(columnProperties);

      return {
        rowProperties: null,
        columnProperties,
        ignoredColumns: ignoredColumnsWithChildren,
        hiddenColumnProperties: hiddenColumnProperties
      };
    }
    const columnProperties = buildColumnProperties({ rowProperties, allColumns, defaultColumns });

    var rowProps = Object.assign({}, rowProperties.props);
    delete rowProps.children;

    if (!rowProps.hasOwnProperty('childColumnName')) {
      rowProps.childColumnName = 'children';
    }

    const hiddenColumnProperties = getHiddenColumns(columnProperties);

    //make sure that children is in the ignored column list

    return {
      rowProperties: rowProps,
      columnProperties,
      hiddenColumnProperties,
      ignoredColumns: ignoredColumnsWithChildren,
      metadataColumn: '__metadata'
    };
  }
};

export default PropertyHelper;

import * as Helpers from '../propertyHelper';

describe ('PropertyHelper', () => {
  describe('buildColumnProperties', () => {
    it('sets an array of properties when children are an array', () => {
      const rowProperties = {
        props: {
          children: [
            { props: { id: 1, name: "one"}},
            { props: { id: 2, name: "two"}}
          ]
        }
      }
      const columnProperties = Helpers.buildColumnProperties({ rowProperties });

      expect(columnProperties).toEqual({
        1: { id: 1, name: "one"},
        2: { id: 2, name: "two"}
      });
    });
  });

  it('sets a single property when children is one item', () => {
       const rowProperties = {
        props: {
          children: { props: { id: 2, name: "two"}}
        }
      }

      const columnProperties = Helpers.buildColumnProperties({ rowProperties });

      expect(columnProperties).toEqual({ 2: { id: 2, name: "two"}});
  });

  it('builds column properties for column array if no children specified', () => {
    const rowProperties = null;
    const columnProperties = Helpers.buildColumnProperties({ rowProperties, allColumns: ['one', 'two', 'three'] });
    expect(columnProperties).toEqual({
      one: { id: 'one' },
      two: { id: 'two' },
      three: { id: 'three' }
    });
  });

  it('uses default columns if specified', () => {
    const defaultColumns = ['one', 'two', 'three'];
    const columnProperties = Helpers.buildColumnProperties({ defaultColumns });

    expect(columnProperties).toEqual({
      one: { id: 'one' },
      two: { id: 'two' },
      three: { id: 'three' }
    });
  });

  it('overrides default columns with columnProperties', () => {
    const defaultColumns = ['one', 'two', 'three'];
    const rowProperties = {
      props: {
        children: [
          { props: { id: 'one', name: "ichi"}},
        ]
      }
    }
    const columnProperties = Helpers.buildColumnProperties({ defaultColumns });

    expect(columnProperties).toEqual({
      one: { id: 'one' },
      two: { id: 'two' },
      three: { id: 'three' }
    });
  });
});

import GriddleRedux, {
  previousOrCombined,
  combinePlugins,
  composer,
  combineComponents
} from '../griddle-redux';

describe('GriddleRedux', () => {
  describe('previousOrCombined', () => {
    it('combines values if they exist', () => {
      const value = previousOrCombined(['one', 'two', 'three'], 'four');
      expect(value).toEqual(['one', 'two', 'three', 'four']);
    });

    it('returns original value if additional value not specified', () => {
      const value = previousOrCombined(['one', 'two']);
      expect(value).toEqual(['one', 'two']);
    });

    it('is undefined if no parameters are specified', () => {
      const value = previousOrCombined();
      expect(value).toBe(undefined);
    });
  });

  describe('combinePlugins', () => {
    it('combines a series of plugins into one plugin', () => {
      const plugin1 = {
        reducers: 'reducer-one',
        states: 'state-one',
        helpers: 'helper-one',
        components: 'component-one'
      }

      const plugin2 = {
        reducers: 'reducer-two',
        states: 'state-two',
        helpers: 'helper-two',
        components: 'component-two'
      }

      const combinedPlugins = combinePlugins([plugin1, plugin2]);

      expect(combinedPlugins.reducers).toEqual(['reducer-one', 'reducer-two']);
      expect(combinedPlugins.states).toEqual(['state-one', 'state-two']);
      expect(combinedPlugins.helpers).toEqual(['helper-one', 'helper-two']);
      expect(combinedPlugins.components).toEqual(['component-one', 'component-two']);
    });

    it('returns an empty array for any items that have no values', () => {
      const plugin1 = {
        reducers: 'reducer-one',
        states: 'state-one',
        helpers: 'helper-one',
      }

      const plugin2 = {
        reducers: 'reducer-two',
        states: 'state-two',
        helpers: 'helper-two',
      }

      const combinedPlugins = combinePlugins([plugin1, plugin2]);

      expect(combinedPlugins.reducers).toEqual(['reducer-one', 'reducer-two']);
      expect(combinedPlugins.states).toEqual(['state-one', 'state-two']);
      expect(combinedPlugins.helpers).toEqual(['helper-one', 'helper-two']);
      expect(combinedPlugins.components).toEqual([]);
    });

    it('returns only results from plugins that have values', () => {
      const plugin = { components: 'one' };
      const plugin2 = {};
      const plugin3 = { components: 'three' }

      const combinedPlugins = combinePlugins([plugin, plugin2, plugin3]);

      expect(combinedPlugins.components).toEqual(['one', 'three']);
    });
  });

  describe('composer', () => {
    it('applies functions in the order they are recieved', () => {
      const composed = composer(
        [
          (input) => { return `${input}First`; },
          (input) => { return `${input}Second`; },
          (input) => {return `${input}Third`; }
        ]
      )("1");

      expect(composed).toEqual("1FirstSecondThird");
    });
  });

  describe('combineComponents', () => {
    it('returns undefined if plugins or components are not specified', () => {
      const withPlugins = combineComponents({plugins: ['one', 'two', 'three']});
      const withComponents = combineComponents({originalComponents: ['one', 'two', 'three']});

      expect(withPlugins).toBe(undefined);
      expect(withComponents).toBe(undefined);
    });

    it('wraps the components with plugins as expected', () => {
      const components = {
        one: "ONE",
        two: "TWO"
      }

      const plugins = [
        { components: {
          one: (component) => (`1 ${component}`),
        }},
        { components: {
          one: (component) => (`${component} 2`),
        }},
        { components: {
          one: (component) => (`${component} 3`)
        }}
      ]

      const combined = combineComponents({ plugins, components });
      expect(combined.one).toEqual('1 ONE 2 3');
    })
  })
});
